import React from "react";
import "./footer.css";
export const Footer = () => {
  return (
    <div>
      <footer className="bg-[#1F1E24] text-zinc-100 border-t-1 border-zinc-100 ">
        <div className="max-w-7xl mx-auto py-3 px-5 sm:px-6 lg:px-8">
          <p className="text-center text-base">&copy; 2024 Career Crafter. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
};
